from itertools import product
import pytest

from tests_rpl.rpltests.expressions import expression_testing
from tests_rpl.rpltests.rpl_cases import RplCaseProgram, auto_cases, check_success_cases
from tests_rpl.rpltests.rpl_testing import RplTestProgram, check_compile_issues, IssueCode, \
        check_compile_success, check_run_result, merge_text, generate_assert


class TestMessageDeclaration:
    """Validates TBD"""
    #TODO: fix docstrings!
    #TODO: format with black!
    success_case_programs = []

    def collect_cases_a_1_declared_matched_name_matched_type(self):
        # Requirement: RPL-MSG-D01
        """
        Verifies case when messages are already declared before usage
        and the sender and the recepient types matches.
        """
        num = 1
        for t, v in expression_testing.ALL_TYPES_VALUES_EXAMPLES.items():

            common_program = RplCaseProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;

                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage_a_{num} contains {t};
                    message SendMessage_b_{num} contains {{}};
                    message SendMessage_c_{num} contains {t};

                    message WaitMessage_b_{num} contains {t};
                    message WaitMessage_c_{num} contains {t};
                    """,

                    f"""\
                    actor MyActor;
                    import EmptyActor;
                    import Messages;

                    {expression_testing.ENUM_TYPE_ALIAS}
                    {expression_testing.EMPTY_ACTOR_VARIABLES}
                    on SendMessage_a_{num}(s, d) {{}}
                    on SendMessage_b_{num}(s, d) {{send WaitMessage_b_{num}({v}) >> s;}}
                    on SendMessage_c_{num}(s, d) {{send WaitMessage_c_{num}(d) >> s;}}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                defs_block=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessage_a_{num}({v}) >> myactor;

                send SendMessage_b_{num} >> myactor;
                var result_b_{num} = wait WaitMessage_b_{num} << myactor;

                send SendMessage_c_{num}({v}) >> myactor;
                var result_c_{num} = wait WaitMessage_c_{num} << myactor;

                Testing.complete();
                """
            )

            num += 1
            self.success_case_programs.append(common_program)

    def test_a_2_undeclared_matched_name_matched_type(self):
        # Requirement: RPL-MSG-D01
        "Verifies undeclared messages with matching name and data type leads to CTE E_Undefined."
        for t, v in expression_testing.ALL_TYPES_VALUES_EXAMPLES.items():

            program_a = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",
                    "module Messages;",
                    """
                    actor MyActor;
                    import Messages;
                    on SendMessage(s, d) {}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessage({v}) >> myactor;
                """
            )
            check_compile_issues(program_a, IssueCode.E_Undefined)

            program_b = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",
                    "module Messages;",
                    f"""\
                    actor MyActor;
                    import Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    {expression_testing.EMPTY_ACTOR_VARIABLES}
                    on SendMessage(s, d) {{
                        send WaitMessage({v}) >> s;
                    }}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body="""\
                send SendMessage >> myactor;
                var result = wait WaitMessage << myactor;
                """
            )
            check_compile_issues(program_b, IssueCode.E_Undefined)

            program_c = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",
                    "module Messages;",
                    """
                    actor MyActor;
                    import Messages;
                    on SendMessage(s, d) {
                        send WaitMessage(d) >> s;
                    }
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessage({v}) >> myactor;
                var result = wait WaitMessage << myactor;
                """
            )
            check_compile_issues(program_c, IssueCode.E_Undefined)

