                """,
                main_body=f"""\
                send SendMessageNew({v}) >> myactor;
                """
            )
            check_compile_issues(program_a, IssueCode.E_Undefined)

            program_b = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
